import 'bootstrap/dist/css/bootstrap.min.css';
import './Landing.css';
import logo from "../Img/Startuphub1.png"

function Landing() {
    return (
        <div className="LandingPage ">
            <div className="main-container container-fluid">
                <div className="row">
                <div className="col-8 left-side container-fluid">
                    <div className="row">
                        <img className="logo" src={logo}></img>
                    </div>
                    <div className="row">
                        <p>Have a business idea, a potential product or looking for <br></br>networking and funding? Tap on Get Started and begin your Journey</p>
                        <p></p>
                    </div>
                </div>
                <div className="col-4 right-side"></div>
                </div>
            </div>
            <div className="footer"></div>
        </div>
    );
  }

  export default Landing;
